" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Ioxaglate meglumine and ioxaglate sodium: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"mobipreview.htm?3/18/3364?source=see_link\">",
"    see \"Ioxaglate meglumine and ioxaglate sodium: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"mobipreview.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F184042\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Hexabrix&trade;",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F184045\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Iodinated Contrast Media;",
"     </li>",
"     <li>",
"      Radiological/Contrast Media (Ionic, Low Osmolality)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block dor drugH1Div\" id=\"F15962290\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Renal Impairment",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No dosage adjustment provided in manufacturer&rsquo;s labeling. Use caution in severe impairment and in setting of combined renal and hepatic disease.",
"    </p>",
"   </div>",
"   <div class=\"block doh drugH1Div\" id=\"F15962291\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Hepatic Impairment",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No dosage adjustment provided in manufacturer&rsquo;s labeling. Use caution in patients with combined hepatic and renal disease.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F184034\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Injection, solution:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Hexabrix&trade;: Ioxaglate meglumine 39.3% and ioxaglate sodium 19.6% (20 mL, 50 mL, 100 mL, 150 mL, 200 mL) [provides organically-bound iodine 32% (320 mg/mL); contains edetate calcium disodium, sodium 3.48 mg (0.15 mEq)/mL]",
"    </p>",
"   </div>",
"   <div class=\"block geq drugH1Div\" id=\"F184030\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Generic Equivalent Available: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No",
"    </p>",
"   </div>",
"   <div class=\"block scp drugH1Div\" id=\"F13791583\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Compatibility",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      Y-site administration: Compatible:",
"     </b>",
"     Fenoldopam.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      Compatibility in syringe: Compatible:",
"     </b>",
"     Ampicillin, chloramphenicol, epinephrine, heparin, hydrocortisone sodium succinate, methylprednisolone sodium succinate.",
"     <b>",
"      Incompatible:",
"     </b>",
"     Cimetidine, diphenhydramine, protamine.",
"     <b>",
"      Variable (consult detailed reference):",
"     </b>",
"     Gentamicin, papaverine.",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F184035\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Angiocardiography, arteriography, aortography, arthrography, angiography, hysterosalpingography, venography, and urography procedures; contrast enhancement of computed tomographic imaging",
"    </p>",
"   </div>",
"   <div class=\"block mst drugH1Div\" id=\"F5174554\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Medication Safety Issues",
"    </span>",
"    <div class=\"collapsible\">",
"     <span class=\"collapsible-title\">",
"      High alert medication:",
"     </span>",
"     <div class=\"collapsible-wrap\">",
"      <p style=\"text-indent:-2em;margin-left:4em;\">",
"       The Institute for Safe Medication Practices (ISMP) includes this medication among its list of drugs which have a heightened risk of causing significant patient harm when used in error.",
"      </p>",
"     </div>",
"    </div>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F184037\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hypersensitivity to ioxaglate or any component of the formulation; myelography; hysterosalpingography during the menstrual period, pregnancy, genital tract infection, or  cervical conization or curettage within 30 days; arthrography with infection present in or near the joint",
"    </p>",
"   </div>",
"   <div class=\"block prf drugH1Div\" id=\"F184032\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Risk Factor",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     B (",
"     <a class=\"graphic graphic_table\" href=\"mobipreview.htm?16/42/17068\">",
"      show table",
"     </a>",
"     )",
"    </p>",
"   </div>",
"   <div class=\"block pri drugH1Div\" id=\"F184039\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Implications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Animal reproduction studies did not show fetal harm. In general, iodinated contrast media agents are avoided during pregnancy unless essential for diagnosis.",
"    </p>",
"   </div>",
"   <div class=\"block lac drugH1Div\" id=\"F184043\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Lactation",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Enters breast milk/not recommended",
"    </p>",
"   </div>",
"   <div class=\"block brc drugH1Div\" id=\"F184040\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Breast-Feeding Considerations",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Bottle feedings are recommended for 24 hours after administration.",
"    </p>",
"   </div>",
"   <div class=\"block dic drugH1Div\" id=\"F9732468\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dietary Considerations",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Some products may contain sodium.",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F6038662\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Hexabrix (AT, BE, CH, CZ, DE, DK, FI, FR, GB, GR, HN, IT, NL, NO, NZ, PT, SE, SG, TR)",
"     </li>",
"    </ul>",
"   </div>",
"  </div>",
