"      Patient information: ECG and stress test (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?31/30/32226?source=see_link\">",
"      Patient information: Nuclear heart testing (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?20/42/21156?source=see_link\">",
"      Patient information: Recovery after coronary artery bypass graft surgery (CABG) (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?32/2/32803?source=see_link\">",
"      Patient information: What can go wrong after a heart attack? (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?34/53/35667?source=see_link\">",
"      Patient information: Cardiac catheterization (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?26/57/27539?source=see_link\">",
"      Patient information: High blood pressure emergencies (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?33/39/34419?source=see_link\">",
"      Patient information: Sudden cardiac arrest (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?23/5/23635?source=see_link\">",
