"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?6/54/7012?source=see_link\">",
"      Patient information: Coronary heart disease in women (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?13/40/13956?source=see_link\">",
"      Patient information: Diastolic heart failure (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?7/32/7684?source=see_link\">",
"      Patient information: Systolic heart failure (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"mobipreview.htm?35/6/35938?source=see_link\">",
"      Patient information: Stress-induced cardiomyopathy (The Basics)",
"     </a>",
"    </p>",
"    <p class=\"headingAnchor2\" id=\"H112838328\">",
"     <span class=\"h3\">",
"      Beyond the Basics",
"     </span>",
"     &nbsp;&mdash;&nbsp;Beyond the Basics patient education pieces are longer, more sophisticated, and more detailed. These articles are best for patients who want in-depth information and are comfortable with some medical jargon.",
"    </p>",
"    <p>",
"     <a class=\"medical medical_patient\" href=\"mobipreview.htm?17/38/18020?source=see_link\">",
"      Patient information: Heart stents and angioplasty (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"mobipreview.htm?30/62/31717?source=see_link\">",
"      Patient information: Coronary artery bypass graft surgery (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"mobipreview.htm?11/52/12100?source=see_link\">",
"      Patient information: Heart attack recovery (Beyond the Basics)",
"     </a>",
"     <br/>",
"    </p>",
"    <p class=\"headingAnchor2\" id=\"H15\">",
"     <span class=\"h2\">",
"      Professional level information",
"     </span>",
"     &nbsp;&mdash;&nbsp;Professional level articles are designed to keep doctors and other health professionals up-to-date on the latest medical findings. These articles are thorough, long, and complex, and they contain multiple references to the research on which they are based. Professional level articles are best for people who are comfortable with a lot of medical terminology and who want to read the same materials their doctors are reading.",
"    </p>",
"    <p>",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?30/10/30890?source=see_link\">",
"      Clinical features and treatment of ventricular arrhythmias during acute myocardial infarction",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?43/41/44697?source=see_link\">",
"      Overview of the acute management of ST elevation myocardial infarction",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?36/20/37193?source=see_link\">",
"      Overview of the acute management of unstable angina and non-ST elevation myocardial infarction",
"     </a>",
"     <br/>",
