"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?40/20/41289?source=see_link\">",
"      Treatment of acute myocardial infarction in diabetes mellitus",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?36/31/37369?source=see_link\">",
"      Selecting a reperfusion strategy for acute ST elevation myocardial infarction",
"     </a>",
