var title_f39_16_40201="Intermediate case 17 answer";
var content_f39_16_40201=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F69478&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F69478&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 526px\">",
"   <div class=\"ttl\">",
"    Monomorphic ventricular tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 506px; height: 295px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This wide complex arrhythmia shows a right bundle branch block morphology with a positive QRS in lead V1. The QS waves in V5 and V6 suggest that the tachycardia originates in the vicinity of an apical-lateral infarct. The diagnosis of VT, rather than supraventricular tachycardia (SVT) with aberration, is supported by the wide R wave in V1 (versus an rSR' pattern which can be seen with SVT or occasionally VT), the very wide QRS (&gt;160 msec, 200 msec here), and the QS waves in V5 and V6. Atrial activity cannot be readily identified in this ECG.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
