var title_f39_16_40204="Syndromic hereditary neurop II";
var content_f39_16_40204=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F52324&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F52324&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical features of hereditary peripheral neuropathies associated with other disorders-II",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"20%\">",
"     </colgroup>",
"     <colgroup width=\"40%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Disorder",
"       </td>",
"       <td class=\"subtitle1\">",
"        Inheritance",
"       </td>",
"       <td class=\"subtitle1\">",
"        Chromosome (gene)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Mitochondrial disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Leigh's syndrome",
"       </td>",
"       <td>",
"        AR",
"       </td>",
"       <td>",
"        9q34 (SURF1)",
"       </td>",
"       <td>",
"        Onset in infancy or childhood, developmental delay, psychomotor regression, brainstem dysfunction, ataxia, dystonia, external ophthalmoplegia, seizures, weakness, lactic acidosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Leber's hereditary optic neuropathy",
"       </td>",
"       <td>",
"        mtDNA",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Affects young adult males, usual onset in late teens, severe permanent visual loss, tremor, multiple sclerosis-like illness, extrapyramidal syndrome, seizures, ataxia, spasticity, mental retardation, peripheral neuropathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        DNA repair disorders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Xeroderma pigmentosa",
"       </td>",
"       <td>",
"        AR",
"       </td>",
"       <td>",
"        (XPA-XPG) (XPV)",
"       </td>",
"       <td>",
"        Peripheral neuropathy, photosensitivity, cutaneous malignancy, skin atrophy and telangiectasia, keratitis, opacification of the cornea, iritis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cockayne syndrome",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        (CS-A) (CS-B)",
"       </td>",
"       <td>",
"        Progressive dementia, large ears and sunken eyes, physical and mental retardation, short stature, microcephaly, progressive neurologic dysfunction, optic atrophy, photosensitivity without increased frequency of cancer",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Ataxia telangiectasia",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        11q22.3 (ATM)",
"       </td>",
"       <td>",
"        Progressive cerebellar ataxia, oculocutaneous telangiectasias, immune deficiency, increased risk of malignancy, radiation sensitivity, diabetes mellitus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Hereditary tyrosinemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Type I",
"       </td>",
"       <td>",
"        AR",
"       </td>",
"       <td>",
"        (FAH)",
"       </td>",
"       <td>",
"        Severe progressive liver disease, renal tubular dysfunction, peripheral neuropathy, extensor hypertonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Type II",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Keratitis, palmoplantar hyperkeratosis, mental retardation, elevated blood tyrosine concentrations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Type III",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Hypertyrosinemia, mental retardation",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     AR: autosomal recessive; mtDNA: mitochondrial DNA; XPA-XPG: xeroderma pigmentosa A-G; XPV: xeroderma pigmentosa variant; ATM: ataxia telangiectasia mutated; FAH: fumarylacetoacetate hydrolase.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
