"       </td>",
"       <td>",
"        0.25-0.5",
"       </td>",
"       <td>",
"        Intermediate",
"       </td>",
"       <td>",
"        Hepatic by CYP3A4 oxidation. No active metabolite.",
"       </td>",
"       <td>",
"        18-50",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lorazepam",
"       </td>",
"       <td>",
"        <p>",
"         0.5-6",
"        </p>",
"        <p>",
"         0.5-4 (hypnotic)",
"        </p>",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        Intermediate",
"       </td>",
"       <td>",
"        Hepatic by glucuronidation (rapid). No active metabolite.",
"       </td>",
"       <td>",
"        10-14",
"       </td>",
